B.Ug=new A.ms(" R\xe8gles strictes :\n 1.  \xc9crivez en fran\xe7ais [NOVEL_LANGUAGE].\n 2.  La longueur du chapitre doit \xeatre d'environ 3000 caract\xe8res.\n 3.  Maintenez la coh\xe9rence avec le genre \"[NOVEL_GENRE]\" et les sp\xe9cifications \"[NOVEL_SPECIFICATIONS]\".\n 4.  Rendez l'histoire captivante et donnez envie au lecteur de continuer \xe0 lire (sauf pour le chapitre final). Plantez activement des rebondissements et laissez des myst\xe8res.\n 5.  **Tr\xe8s important** : Commencez votre r\xe9ponse directement par la ligne du titre du chapitre. **N'\xe9crivez RIEN** avant cette ligne (pas de salutations, confirmations, commentaires, etc.).\n 6.  N'utilisez aucun formatage Markdown (pas de gras, pas d'italique). N'utilisez pas d'ast\xe9risques (*) ou de tirets bas (_) pour l'emphase.\n 7.  **Format des dialogues**: Utilisez **toujours** des guillemets fran\xe7ais (\xab \xbb) ou des guillemets doubles (\"\") pour encadrer les dialogues. **N'utilisez jamais** de tirets cadratins (\u2014) pour les dialogues.\n 8.  **Style d'\xe9criture** : La prose doit ressembler \xe0 celle d'un roman publi\xe9, pas \xe0 un script.\n \n 9.  **Analyse du Contexte (Fanfiction vs. Original)**: // --- NOUVELLE R\xc8GLE ---\n     - Avant d'\xe9crire, d\xe9terminez si le champ \"[NOVEL_SPECIFICATIONS]\" d\xe9crit une **histoire originale** ou une **fanfiction** (bas\xe9e sur une \u0153uvre existante : livre, film, jeu, etc.).\n     - Si c'est une **fanfiction** : Votre priorit\xe9 est de respecter l'univers, les personnages et l'histoire de l'\u0153uvre de base. Utilisez vos connaissances sur cette \u0153uvre. Appliquez ensuite les sp\xe9cifications de l'utilisateur par-dessus cette base.\n     - Si c'est une **histoire originale** : N'inventez que ce qui est n\xe9cessaire et basez-vous *strictement* sur les sp\xe9cifications fournies.\n\n 15. **Paragraphes** : Structurez le texte avec des paragraphes appropri\xe9s. **Toujours** utiliser un double saut de ligne (une ligne vide) entre les paragraphes pour la lisibilit\xe9.\n\n\nPrincipe d'\xe9criture fondamental - \"Montrer, ne pas dire\" :\n10. **Ne r\xe9sumez PAS les \xe9v\xe9nements**. Ne faites pas d'avance rapide dans l'histoire. Concentrez-vous sur une seule sc\xe8ne significative ou une courte p\xe9riode, plut\xf4t que d'essayer de couvrir trop de terrain en un seul chapitre.\n11. **D\xe9crivez en d\xe9tail** : D\xe9crivez l'atmosph\xe8re des lieux, les expressions faciales des personnages et les d\xe9tails sensoriels (odeurs, sons, textures).\n12. **D\xe9peignez la vie int\xe9rieure** : Au lieu d'\xe9noncer directement l'\xe9motion d'un personnage (par ex., \"Il \xe9tait triste\"), **montrez-la** \xe0 travers ses actions, ses pens\xe9es et ses dialogues (par ex., \"Ses \xe9paules s'affaiss\xe8rent et son regard resta fix\xe9 sur le sol.\").\n13. **Rythme** : **Ne** pr\xe9cipitez **pas** l'histoire. Prenez du temps pour la psychologie des personnages et la construction du monde. Posez des bases suffisantes avant les \xe9v\xe9nements majeurs.\n14. **Coh\xe9rence** : Assurez-vous que les actions des personnages sont coh\xe9rentes avec leur personnalit\xe9 et leurs motivations \xe9tablies. Maintenez le d\xe9roulement logique de l'intrigue en fonction du contexte fourni.\n","Cr\xe9ez le **premier chapitre** d'un nouveau roman en [NOVEL_LANGUAGE] avec les caract\xe9ristiques suivantes :",'\xc9crivez le **chapitre suivant (Chapitre [NEXT_CHAPTER_NUMBER])** pour le roman "[NOVEL_TITLE]".','\xc9crivez le **chapitre final** pour le roman "[NOVEL_TITLE]", menant l\'histoire \xe0 une conclusion satisfaisante.'," Instructions suppl\xe9mentaires pour le chapitre final :\n - Cr\xe9ez une fin coh\xe9rente bas\xe9e sur la progression de l'histoire jusqu'\xe0 pr\xe9sent. R\xe9solvez ou concluez les principaux rebondissements et myst\xe8res autant que possible.\n - D\xe9crivez la situation finale et les sentiments des personnages.\n ","Dernier chapitre (Chapitre [CHAPTER_NUMBER]):","Contexte pertinent :","Pour rappel, la derni\xe8re phrase \xe9tait :",'\n**PRIORIT\xc9 ABSOLUE (ANCRAGE) :** Le nouveau chapitre doit commencer **exactement l\xe0 o\xf9 le pr\xe9c\xe9dent s\'est arr\xeat\xe9**. Votre premi\xe8re phrase doit \xeatre la suite **imm\xe9diate et directe** de cette derni\xe8re phrase : "[LAST_SENTENCE]" (qui vient d\'\xeatre fournie). Ne sautez PAS dans le temps (pas de "Le lendemain matin..." ou de changement soudain de lieu).'," Format de sortie requis (n'\xe9crivez rien avant cette ligne) :\n Chapitre 1 : [Un titre captivant pour ce premier chapitre]\n\n [\xc9crivez le contenu du Chapitre 1 ici...]\n "," Format de sortie requis (n'\xe9crivez rien avant cette ligne) :\n Chapitre [NEXT_CHAPTER_NUMBER] : [Un titre int\xe9ressant pour ce nouveau chapitre]\n\n [\xc9crivez le contenu du Chapitre [NEXT_CHAPTER_NUMBER] ici...]\n "," Format de sortie requis (n'\xe9crivez rien avant cette ligne) :\n Chapitre Final : [Un titre \xe9mouvant ou stimulant pour ce chapitre final]\n\n [\xc9crivez le contenu du chapitre final ici...]\n ","Chapitre 1","Chapitre Final","Chapitre ","","Pas de contexte disponible.","C'est le premier chapitre.","Plan de l'histoire (R\xe9sum\xe9 g\xe9n\xe9ral de l'histoire jusqu'\xe0 pr\xe9sent)","--- Extrait pertinent [NUMBER] ---","--- Fin de l'extrait ---","Vous \xeates un ma\xeetre planificateur d'histoires.\nVoici le concept du roman :\n- Titre : [NOVEL_TITLE]\n- Genre : [NOVEL_GENRE]\n- Sp\xe9cifications : [NOVEL_SPECIFICATIONS]\n\nVoici le r\xe9sum\xe9 de ce qui s'est d\xe9j\xe0 pass\xe9 (le \"Roadmap\") :\n<Roadmap du Pass\xe9>\n[CURRENT_ROADMAP]\n</Roadmap du Pass\xe9>\n\nVotre t\xe2che est de cr\xe9er un **plan directeur (sommaire)** pour les **10 prochains chapitres**.\nLe plan doit \xeatre une liste de 10 points, chaque point \xe9tant une **phrase unique et concise** d\xe9crivant l'\xe9v\xe9nement principal ou le d\xe9veloppement de ce chapitre.\nLe rythme doit \xeatre **lent et naturel**, \xe0 la mani\xe8re d'un roman humain. D\xe9veloppez un seul arc narratif de mani\xe8re progressive, pas 10 mini-histoires.\n\nFormat de sortie OBLIGATOIRE (uniquement la liste) :\n1. [Phrase pour le Chapitre N+1]\n2. [Phrase pour le Chapitre N+2]\n...\n10. [Phrase pour le Chapitre N+10]\n","Plan directeur des 10 prochains chapitres (fil rouge) :","\n**R\xe8gle de priorit\xe9** : Ce plan est votre fil rouge. MAIS, s'il entre en conflit avec la suite logique de la phrase/chapitre pr\xe9c\xe9dent, **donnez toujours la priorit\xe9 \xe0 la suite logique** (le contexte FAISS).")
B.Uh=new A.ms(' Reglas estrictas:\n 1.  Escribe en [NOVEL_LANGUAGE].\n 2.  La longitud del cap\xedtulo debe ser de aproximadamente 3000 caracteres.\n 3.  Mant\xe9n la coherencia con el g\xe9nero "[NOVEL_GENRE]" y las especificaciones "[NOVEL_SPECIFICATIONS]".\n 4.  Haz la historia atractiva y que el lector quiera seguir leyendo (excepto en el cap\xedtulo final).\n 5.  **Muy importante**: Comienza tu respuesta directamente con la l\xednea del t\xedtulo del cap\xedtulo. **NO** escribas nada antes de esta l\xednea.\n 6.  No uses ning\xfan formato Markdown (negrita, cursiva).\n 7.  **Formato de di\xe1logo**: Usa **siempre** comillas dobles ("") para los di\xe1logos.\n 8.  **Estilo de escritura**: La prosa debe parecerse a la de una novela publicada, no a un guion.\n \n 9.  **An\xe1lisis de Contexto (Fanfiction vs. Original)**: // --- NOUVELLE R\xc8GLE ---\n     - Antes de escribir, determina si el campo "[NOVEL_SPECIFICATIONS]" describe una **historia original** o una **fanfiction** (basada en una obra existente: libro, pel\xedcula, juego, etc.).\n     - Si es una **fanfiction**: Tu prioridad es respetar el lore, los personajes y la trama de la obra original. Utiliza tu conocimiento de esa obra. Luego, aplica las especificaciones del usuario sobre esa base.\n     - Si es una **historia original**: Basa tu creaci\xf3n *estrictamente* en las especificaciones proporcionadas.\n \n 15. **P\xe1rrafos**: Estructura el texto con p\xe1rrafos adecuados. **Siempre** usa un doble salto de l\xednea (una l\xednea vac\xeda) entre p\xe1rrafos para facilitar la lectura.\n\nPrincipio de escritura - "Mostrar, no contar": // --- NUM\xc9ROTATION MISE \xc0 JOUR ---\n10. **NO resumas los eventos**. Conc\xe9ntrate en una sola escena significativa.\n11. **Describe en detalle**: La atm\xf3sfera, las expresiones faciales, los detalles sensoriales.\n12. **Representa la vida interior**: Muestra las emociones a trav\xe9s de acciones, no las nombres directamente.\n13. **Ritmo**: No apresures la historia. T\xf3mate tiempo para la psicolog\xeda de los personajes.\n14. **Coherencia**: Aseg\xfarate de que las acciones de los personajes sean coherentes.\n',"Crea el **primer cap\xedtulo** de una nueva novela en [NOVEL_LANGUAGE] con las siguientes caracter\xedsticas:",'Escribe el **siguiente cap\xedtulo (Cap\xedtulo [NEXT_CHAPTER_NUMBER])** para la novela "[NOVEL_TITLE]".','Escribe el **cap\xedtulo final** para la novela "[NOVEL_TITLE]", llevando la historia a una conclusi\xf3n satisfactoria.',"Instrucciones adicionales para el cap\xedtulo final: Crea un final coherente. Resuelve las tramas principales. Describe la situaci\xf3n final de los personajes.","\xdaltimo cap\xedtulo (Cap\xedtulo [CHAPTER_NUMBER]):","Contexto relevante:","Como recordatorio, la \xfaltima frase fue:",'\n**PRIORIDAD ABSOLUTA (ANCLAJE):** El nuevo cap\xedtulo debe comenzar **exactamente donde termin\xf3 el anterior**. Tu primera frase debe ser la continuaci\xf3n **inmediata y directa** de esta \xfaltima frase: "[LAST_SENTENCE]" (que se acaba de proporcionar). NO saltes en el tiempo (nada de "A la ma\xf1ana siguiente..." o cambios bruscos de ubicaci\xf3n).',"Formato requerido:\nCap\xedtulo 1: [T\xedtulo atractivo]\n\n[Contenido del Cap\xedtulo 1 aqu\xed...]","Formato requerido:\nCap\xedtulo [NEXT_CHAPTER_NUMBER]: [T\xedtulo interesante]\n\n[Contenido del Cap\xedtulo [NEXT_CHAPTER_NUMBER] aqu\xed...]","Formato requerido:\nCap\xedtulo Final: [T\xedtulo emotivo]\n\n[Contenido del cap\xedtulo final aqu\xed...]","Cap\xedtulo 1","Cap\xedtulo Final","Cap\xedtulo ","","No hay contexto disponible.","Este es el primer cap\xedtulo.","Plan de la historia (Resumen general de la historia hasta ahora)","--- Extracto relevante [NUMBER] ---","--- Fin del extracto ---",'Eres un maestro planificador de historias.\nAqu\xed est\xe1 el concepto de la novela:\n- T\xedtulo: [NOVEL_TITLE]\n- G\xe9nero: [NOVEL_GENRE]\n- Especificaciones: [NOVEL_SPECIFICATIONS]\n\nAqu\xed est\xe1 el resumen de lo que ya ha sucedido (el "Roadmap"):\n<Roadmap Pasado>\n[CURRENT_ROADMAP]\n</Roadmap Pasado>\n\nTu tarea es crear un **esquema de la trama (sumario)** para los **pr\xf3ximos 10 cap\xedtulos**.\nEl plan debe ser una lista de 10 puntos, siendo cada punto una **\xfanica oraci\xf3n concisa** que describa el evento principal o desarrollo de ese cap\xedtulo.\nEl ritmo debe ser **lento y natural**, como el de una novela humana. Desarrolla un solo arco argumental de forma progresiva, no 10 mini-historias.\n\nFormato de salida OBLIGATORIO (solo la lista):\n1. [Frase para el Cap\xedtulo N+1]\n2. [Frase para el Cap\xedtulo N+2]\n...\n10. [Frase para el Cap\xedtulo N+10]\n',"Esquema de la trama para los pr\xf3ximos 10 cap\xedtulos (hilo conductor):","\n**Regla de prioridad**: Este esquema es tu hilo conductor. SIN EMBARGO, si entra en conflicto con la continuaci\xf3n l\xf3gica de la frase/cap\xedtulo anterior, **siempre prioriza la continuaci\xf3n l\xf3gica** (el contexto FAISS).")
