B.Uk=new A.ms(' Regole severe:\n 1.  Scrivi in [NOVEL_LANGUAGE].\n 2.  La lunghezza del capitolo dovrebbe essere di circa 3000 caratteri.\n 3.  Mantieni la coerenza con il genere "[NOVEL_GENRE]" e le specifiche "[NOVEL_SPECIFICATIONS]".\n 4.  Rendi la storia coinvolgente e invoglia il lettore a continuare a leggere (tranne per il capitolo finale).\n 5.  **Molto importante**: Inizia la tua risposta direttamente con la riga del titolo del capitolo. **NON** scrivere nulla prima di questa riga.\n 6.  Non usare alcun formato Markdown (grassetto, corsivo).\n 7.  **Formato dei dialoghi**: Usa **sempre** le virgolette doppie ("") per i dialoghi.\n 8.  **Stile di scrittura**: La prosa deve assomigliare a quella di un romanzo pubblicato, non a una sceneggiatura.\n\n 9.  **Analisi del Contesto (Fanfiction vs. Originale)**: // --- NOUVELLE R\xc8GLE ---\n     - Prima di scrivere, determina se il campo "[NOVEL_SPECIFICATIONS]" descrive una **storia originale** o una **fanfiction** (basata su un\'opera esistente: libro, film, gioco, ecc.).\n     - Se \xe8 una **fanfiction**: La tua priorit\xe0 \xe8 rispettare la lore, i personaggi e la trama dell\'opera originale. Usa la tua conoscenza di quell\'opera. Quindi, applica le specifiche dell\'utente su quella base.\n     - Se \xe8 una **storia originale**: Basa la tua creazione *strettamente* sulle specifiche fornite.\n \n 15. **Paragrafi**: Struttura il testo con paragrafi appropriati. **Sempre** usare un doppio a capo (una riga vuota) tra i paragrafi per la leggibilit\xe0.\n\nPrincipio di scrittura - "Mostra, non raccontare": // --- NUM\xc9ROTATION MISE \xc0 JOUR ---\n10. **NON riassumere gli eventi**. Concentrati su una singola scena significativa.\n11. **Descrivi in dettaglio**: L\'atmosfera, le espressioni facciali, i dettagli sensoriali.\n12. **Rappresenta la vita interiore**: Mostra le emozioni attraverso le azioni, non nominarle direttamente.\n13. **Ritmo**: Non affrettare la storia. Prenditi tempo per la psicologia dei personaggi.\n14. **Coerenza**: Assicurati che le azioni dei personaggi siano coerenti.\n',"Crea il **primo capitolo** di un nuovo romanzo in [NOVEL_LANGUAGE] con le seguenti caratteristiche:",'Scrivi il **capitolo successivo (Capitolo [NEXT_CHAPTER_NUMBER])** per il romanzo "[NOVEL_TITLE]".','Scrivi il **capitolo finale** per il romanzo "[NOVEL_TITLE]", portando la storia a una conclusione soddisfacente.',"Istruzioni aggiuntive per il capitolo finale: Crea un finale coerente. Risolvi le trame principali. Descrivi la situazione finale dei personaggi.","Ultimo capitolo (Capitolo [CHAPTER_NUMBER]):","Contesto rilevante:","Per promemoria, l'ultima frase era:",'\n**PRIORIT\xc0 ASSOLUTA (ANCORAGGIO):** Il nuovo capitolo deve iniziare **esattamente dove si \xe8 interrotto il precedente**. La tua prima frase deve essere la continuazione **immediata e diretta** di quest\'ultima frase: "[LAST_SENTENCE]" (appena fornita). NON saltare nel tempo (niente "La mattina dopo..." o cambi improvvisi di luogo).',"Formato richiesto:\nCapitolo 1: [Titolo accattivante]\n\n[Contenuto del Capitolo 1 qui...]","Formato richiesto:\nCapitolo [NEXT_CHAPTER_NUMBER]: [Titolo interessante]\n\n[Contenuto del Capitolo [NEXT_CHAPTER_NUMBER] qui...]","Formato richiesto:\nCapitolo Finale: [Titolo commovente]\n\n[Contenuto del capitolo finale qui...]","Capitolo 1","Capitolo Finale","Capitolo ","","Nessun contesto disponibile.","Questo \xe8 il primo capitolo.","Piano della storia (Riassunto generale della storia finora)","--- Estratto pertinente [NUMBER] ---","--- Fine dell'estratto ---","Sei un maestro pianificatore di storie.\nEcco il concetto del romanzo:\n- Titolo: [NOVEL_TITLE]\n- Genere: [NOVEL_GENRE]\n- Specifiche: [NOVEL_SPECIFICATIONS]\n\nEcco il riassunto di ci\xf2 che \xe8 gi\xe0 accaduto (la \"Roadmap\"):\n<Roadmap Passata>\n[CURRENT_ROADMAP]\n</Roadmap Passata>\n\nIl tuo compito \xe8 creare una **bozza della trama (sommario)** per i **prossimi 10 capitoli**.\nIl piano deve essere un elenco di 10 punti, ogni punto \xe8 una **singola frase concisa** che descrive l'evento principale o lo sviluppo di quel capitolo.\nIl ritmo deve essere **lento e naturale**, come quello di un romanzo umano. Sviluppa un singolo arco narrativo in modo progressivo, non 10 mini-storie.\n\nFormato di output OBBLIGATORIO (solo l'elenco):\n1. [Frase per il Capitolo N+1]\n2. [Frase per il Capitolo N+2]\n...\n10. [Frase per il Capitolo N+10]\n","Bozza della trama per i prossimi 10 capitoli (filo conduttore):","\n**Regola di priorit\xe0**: Questa bozza \xe8 il tuo filo conduttore. TUTTAVIA, se \xe8 in conflitto con la continuazione logica della frase/capitolo precedente, **dai sempre la priorit\xe0 alla continuazione logica** (il contesto FAISS).")
